import { motion } from "framer-motion"


const Home = () => {
  return (
      <motion.div className="AK-SE"
        initial={{opactity: 0}}
        animate={{opactiy: 1, height: 1}}
        exit={{opacity: 0, height: 0, transition: {duration: .3}}}
      >
        <motion.div className="headings"
        initial={{opactity: 0}}
        animate={{opactiy: 1, transition: {duration: 5}}}
        exit={{opacity: 0, transition: {duration: 1}}}
        >
        <div className="name">
          <h2>ANDREW KEIR</h2>
        </div>

        <div className="name-blur">
          <h2>ANDREW KEIR</h2>
        </div>

        <div className="title">
          <h2>Software Engineer</h2>
        </div>

        <div className="title-blur">
          <h2>Software Engineer</h2>
        </div>
        </motion.div>
      </motion.div>
  )
}

export default Home
